#include <iostream>
using namespace std;

class Node {
public:
	int data;
	Node* p;
	Node* left;
	Node* right;

	Node(int data) {
		this->data = data;
		p = nullptr;
		left = nullptr;
		right = nullptr;
	}

	void insertLeft(Node* left) {
		this->left = left;
		left->p = this;
	}

	void insertRight(Node* right) {
		this->right = right;
		right->p = this;
	}


};

class BST {
public:
	Node* root;
	int n;

	BST() {
		root = nullptr;
		n = 0;
	}
	~BST() {
		treeDestructor(this->root);
	}
	void treeDestructor(Node* root) {
		if (root == nullptr)
			return;
		if (root->left != nullptr)
			treeDestructor(root->left);
		if (root->right != nullptr)
			treeDestructor(root->right);
		delete root;
	}
	void insertNode(int data) {
		Node* newNode = new Node(data);
		if (root == nullptr)
			root = newNode;
		else {
			Node* tmp = root;
			Node* p = tmp->p;

			while (tmp != nullptr) {
				if (tmp->data == data)
					return;
				else {
					if (tmp->data < data) {
						if (tmp->right == nullptr) {
							p = tmp;
							if (p->data < data)
								p->insertRight(newNode);
							else
								p->insertLeft(newNode);
							break;
						}
						tmp = tmp->right;
					}
					else {
						if (tmp->left == nullptr) {
							p = tmp;
							if (p->data < data)
								p->insertRight(newNode);
							else
								p->insertLeft(newNode);
							break;
						}
						tmp = tmp->left;
					}
				}
			}
		}
		n += 1;
	}

	void deleteNode(int data) {
		Node* delNode = findNode(data);
		if (delNode == nullptr) {
			return;
		}
		else {
			Node* par = delNode->p;
			if (delNode->left == nullptr) {
				if (par == nullptr) {
					Node* min = findMin(delNode);
					if (min->p != delNode) {
						delNode->data = min->data;
						min->p->left = min->right;
						//delete min;
					}
					else {
						delNode->data = min->data;
						delNode->right = min->right;
						//delete min;
					}
					return;
				}
				if (delNode == par->left) { //삭제할 노드가 왼쪽 자식일 경우
					par->left = delNode->right;
					//delete delNode;
				}
				else if (delNode == par->right) { //삭제할 노드가 오른쪽 자식일 경우
					par->right = delNode->right;
					//delete delNode;
				}
			}
			else if (delNode->right == nullptr) {
				if (par == nullptr) {
					delNode = delNode->left;
					//delete delNode;
					return;
				}
				if (delNode == par->left) { //삭제할 노드가 왼쪽 자식일 경우
					par->left = delNode->left;
					//delete delNode;
				}
				else if (delNode == par->right) { //삭제할 노드가 오른쪽 자식일 경우
					par->right = delNode->left;
					//delete delNode;
				}
			}
			else {
				Node* min = findMin(delNode);
				if (min->p != delNode){
					delNode->data = min->data;
					min->p->left = min->right;
					//delete min;
				}
				else {
					delNode->data = min->data;
					delNode->right = min->right;
					//delete min;
				}
			}
			n -= 1;
		}
	}

	Node* findMin(Node* x) {
		Node* tmp = x->right;
		if (tmp == nullptr) {
			return x->left;
		}
		else 
			while (tmp->left != nullptr) 
				tmp = tmp->left;
		return tmp;
	}

	Node* findNode(int data) {
		Node* tmp = root;
		while (tmp != nullptr) {
			if (tmp->data == data)
				return tmp;
			else {
				if (tmp->data < data)
					tmp = tmp->right;
				else
					tmp = tmp->left;
			}
		}
		return nullptr;
	}
	void preOrder(Node* x) {
		Node* tmp = x;
		if (findNode(x->data) == nullptr) {
			cout << "0" << endl;
			return;
		}
		cout << x->data << ' ';
		if (tmp->left != nullptr) 
			preOrder(tmp->left);
		if (tmp->right != nullptr)
			preOrder(tmp->right);
	}
};

int main() {
	int t;
	cin >> t;
	for (int i = 0;i < t;i++) {
		int n, m;
		cin >> n;
		int x;
		BST bst;
		for (int j = 0;j < n;j++) {
			cin >> x;
			bst.insertNode(x);
		}
		cin >> m;
		for (int j = 0;j < m;j++) {
			cin >> x;
			bst.deleteNode(x);
		}
		bst.preOrder(bst.root);
		cout << '\n';
	}
	return 0;
}


